import React, { Component } from 'react'
import Todos from './components/Todos'

export class App extends Component {
  state = {
    todos: [
      {
        id:1,
        title: "Do it"
      }
    ]
  }
  render() {
    return (
      <div>
        <Todos></Todos>
      </div>
    )
  }
}

export default App
